import React, { useState, useEffect } from 'react';
import {
  Edit,
  Trash2,
  Plus,
  Download,
  Clock,
  Play,
  Pause,
  Search,
} from 'lucide-react';
import { agentStatusClass } from '../utils/format'; // adjust path if needed

const AgentsTable = ({
  user,
  agentSearch,
  setAgentSearch,
  showAgentExport,
  setShowAgentExport,
  filteredAgents,
  exportToExcel,
}) => {
  const [showTimeModal, setShowTimeModal] = useState(false);
  const [selectedAgent, setSelectedAgent] = useState(null);
  const [fromTime, setFromTime] = useState('');
  const [toTime, setToTime] = useState('');
  const [timeWarning, setTimeWarning] = useState('');

  const handleBreakClick = (agent) => {
    setSelectedAgent(agent);
    setShowTimeModal(true);
    setFromTime('');
    setToTime('');
    setTimeWarning('');
  };

  const handleSaveBreak = () => {
    if (!fromTime || !toTime) return;
    if (new Date(`1970-01-01T${toTime}`) <= new Date(`1970-01-01T${fromTime}`)) {
      setTimeWarning('To Time must be greater than From Time');
      return;
    }
    setTimeWarning('');

    // Call backend API to save break (you'll implement this part)
    const breakData = {
      agent_id: selectedAgent.agent_id,
      from_time: fromTime,
      to_time: toTime,
    };
    console.log('Saving break:', breakData);
    // TODO: Connect to backend function here

    setShowTimeModal(false);
    setFromTime('');
    setToTime('');
    setSelectedAgent(null);
  };

  const handleCancel = () => {
    setShowTimeModal(false);
    setFromTime('');
    setToTime('');
    setTimeWarning('');
  };

  return (
    <div>
      {/* Search and Export Row */}
      <div className="flex justify-between items-center mb-4">
        <input
          type="text"
          placeholder="Search agent..."
          value={agentSearch}
          onChange={(e) => setAgentSearch(e.target.value)}
          className="border p-2 rounded w-64"
        />
        <button
          onClick={exportToExcel}
          className="bg-blue-500 text-white px-4 py-2 rounded"
        >
          <Download className="inline-block mr-2" /> Export
        </button>
      </div>

      {/* Agent Table */}
      <table className="w-full border border-gray-200">
        <thead>
          <tr className="bg-gray-100">
            <th className="p-2 border">Name</th>
            <th className="p-2 border">Number</th>
            <th className="p-2 border">Status</th>
            <th className="p-2 border">Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredAgents.map((agent) => (
            <tr key={agent.agent_id} className="border-b">
              <td className="p-2 border">{agent.agent_name}</td>
              <td className="p-2 border">{agent.agent_number}</td>
              <td className={`p-2 border ${agentStatusClass(agent.status)}`}>
                {agent.status}
              </td>
              <td className="p-2 border">
                {(user.role === 'admin' || user.agent_number === agent.agent_number) && (
                  <button
                    onClick={() => handleBreakClick(agent)}
                    className="bg-yellow-500 text-white px-3 py-1 rounded"
                  >
                    <Clock className="inline-block mr-1" /> Break
                  </button>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Time Selection Modal */}
      {showTimeModal && (
        <div className="fixed inset-0 bg-black bg-opacity-40 flex items-center justify-center z-50">
          <div className="bg-white p-6 rounded shadow-lg w-80">
            <h2 className="text-lg font-bold mb-4">Break Time</h2>
            <label className="block mb-2">
              From Time:
              <input
                type="time"
                value={fromTime}
                onChange={(e) => setFromTime(e.target.value)}
                className="w-full border p-1 rounded"
              />
            </label>
            <label className="block mb-2">
              To Time:
              <input
                type="time"
                value={toTime}
                onChange={(e) => setToTime(e.target.value)}
                className="w-full border p-1 rounded"
              />
            </label>
            {timeWarning && <p className="text-red-500 text-sm mb-2">{timeWarning}</p>}
            <div className="flex justify-end gap-2">
              <button
                onClick={handleCancel}
                className="bg-gray-300 px-3 py-1 rounded"
              >
                Cancel
              </button>
              <button
                onClick={handleSaveBreak}
                className="bg-green-600 text-white px-4 py-1 rounded"
                disabled={!fromTime || !toTime}
              >
                Save
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AgentsTable;
